au6(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,a0,a1,a2,a3,a4,a5,a6,a7,a8,a9){return"Z velikostjo populacije izberete, kako veliko bo za\u010detno \u0161tevilo posameznikov. Ve\u010dja populacija pomeni ve\u010d stikov, ker bo ve\u010dja gne\u010da. Vrednosti lahko nastavite med "+H.d(a)+" in "+H.d(b)+".\n\nInkubacijska doba dolo\u010da, kako dolgo lahko oku\u017eeni nemoteno \u0161irijo oku\u017ebo preden se pojavijo prvi simptomi. Lahko nastavite vrednosti med "+H.d(c)+" in "+H.d(d)+". \u010ce nastavite oboje na 0, pomeni, da ne bo inkubacijske dobe in vsi oku\u017eeni bodo nemudoma zboleli.\n\nOku\u017eeni na za\u010detku je \u0161tevilo oku\u017eenih, s katerimi se bo simulacija pri\u010dela. Lahko nastavite vrednosti od "+H.d(e)+" do celotne populacije. Cepljeni so tudi lahko oku\u017eeni \u017ee na za\u010detku, a v skladu z dolo\u010deno za\u0161\u010dito cepljenja pred oku\u017ebo opisano kasneje.\n\nTrajanje bolezni dolo\u010da, kako dolgo bo trajala bolezen. Lahko nastavite vrednosti od "+H.d(f)+" do "+H.d(g)+". Tudi v tem primeru obe vrednosti nastavljeni na 0 pomenita, da ne bo nih\u010de zbolel. Bodo takoj ozdraveli, ali pa resno zboleli.\n\nZ verjetnostjo te\u017eke bolezni lahko nastavitve koliko bolnih bo resno zbolelo. Dovoljene vrednosti so od "+H.d(h)+"% do "+H.d(i)+"%.\n\nTrajanje te\u017ekega poteka bolezni dolo\u010da, kako dolgo se bodo resno bolni spopadali s te\u017eko boleznijo. Dovoljene vrednosti so med "+H.d(j)+" in "+H.d(k)+".\n\nVerjetnost smrti dolo\u010da, koliko posameznikov bo umrlo. Verjenost je dolo\u010dena za celotno populacijo in ne samo za resno bolne. To pomeni, da bo dejansko ve\u010dji dele\u017e resno bolnih umrl. \u010ce ne bo resno bolnih, seveda nih\u010de ne bo umrl. Vrednosti lahko nastavite od "+H.d(l)+"% do "+H.d(m)+"%.\n\nS precepljenostjo nastavite, koliko populacije bo cepljene. Dovoljene vrednosti so med "+H.d(n)+"% in "+H.d(o)+"%.\n\nU\u010dinkovitost cepiva proti oku\u017ebi dolo\u010da, koliko cepljenih bo s cepivom za\u0161\u010diteno pred oku\u017ebo. Vrednosti so lahko med "+H.d(p)+"% in "+H.d(q)+"%.\n\nU\u010dinkovitost cepiva proti te\u017ejemu poteku bolezni dolo\u010da, koliko bolnih bo za\u0161\u010diteno s ecpivom pred tem, da bi te\u017eje zboleli. Lahko nastavite vrednosti od "+H.d(r)+"% do "+H.d(s)+"%.\n\nU\u010dinkovitost cepljenja proti smrti dolo\u010da, koliko te\u017eko bolnih cepljenih bo pre\u017eivelo. Lahko nastavite vrednosti med "+H.d(a0)+"% in "+H.d(a1)+"%.\n\nZaprtje dru\u017ebe pri povpre\u010dnih oku\u017ebah dolo\u010da, koliko oku\u017eb na dan mora biti v povpre\u010dju, da se dru\u017eba zapre. Lahko nastavite vrednosti od "+H.d(a2)+" do "+H.d(a3)+".\n\nPovpre\u010dno \u0161tevilo dnevnih oku\u017eb z zadnjih dneh dolo\u010da, za koliko dni nazaj naj se ra\u010duna povpre\u010dje. Vrednosti so lahko med "+H.d(a4)+" in "+H.d(a5)+'.\n\n"Zaprtje dru\u017ebe za najmanj" dolo\u010da, koliko dni bo najmanj trajalo zaptrje, \u010de do njega pride. 0 pomeni, da zaprtja ne bo. Lahko nastavite vrednosti med '+H.d(a6)+" in "+H.d(a7)+".\n\nZaprtje vpliva na dolo\u010deno \u0161tevilo posameznikov, medtem ko se lahko nekateri posamezniki \u0161e vedno gibljejo neovirano. Lahko zaprete od "+H.d(a8)+"% do "+H.d(a9)+"% populacije.\n\nKer verjetnost narekuje, kako bo simulacija potekala, mnogi parametri nastavijo le mo\u017enosti. Zato se, na primer, \u0161tevilo cepljenih ni to\u010dno \u0161tevilo nastavljenih cepljenih. Dejansko \u0161tevilo bo nekje okoli nastavljene vrednosti, a vedno razli\u010dno."},
